import React from "react";

const About = () => {
    return (
        <div className="about">
            <h2>In Animals-page you can search animal by its name
            </h2>
            <p>You can see all listed animals in small cards. While typing searched animal, the list is getting shorter. <br />
                Each animal's card can be opened to single animal page, where you can see bigger picture of the animal. And sometimes something related to the animal.<br />
                <br /> You can also check what facts Wikipedia tells of this animal.
            </p>
        </div>
    )
}
export default About;
